func TestMaybe(t *testing.T) {
	var cases = []Maybe[testCase]{
		{Null: true},
		{Null: false, Value: testCase{3, 5}},
	}
	for _, maybe := range cases {
		b1 := boc.NewCell()
		err := Marshal(b1, maybe)
		if err != nil {
			t.Fatal(err)
		}
		var unmarshaled Maybe[testCase]
		err = Unmarshal(b1, &unmarshaled)
		if err != nil {
			t.Fatal(err)
		}
		if !reflect.DeepEqual(maybe, unmarshaled) {
			t.Fatalf("not equal. left: %v, right: %v \n", maybe, unmarshaled)
		}
		b2 := boc.NewCell()
		err = Marshal(b2, unmarshaled)
		if err != nil {
			t.Fatal(err)
		}
		if b1.ToString() != b2.ToString() {
			t.Fatal("not equal")
		}
	}
}

func TestUnary(t *testing.T) {
	type test struct {
		A Unary
	}
	cases := []struct {
		t test
		s string
	}{
		{t: test{A: 0}, s: "0"},
		{t: test{A: 1}, s: "10"},
		{t: test{A: 2}, s: "110"},
		{t: test{A: 3}, s: "1110"},
		{t: test{A: 62}, s: "111111111111111111111111111111111111111111111111111111111111110"},
		{t: test{A: 63}, s: "1111111111111111111111111111111111111111111111111111111111111110"},
		{t: test{A: 64}, s: "11111111111111111111111111111111111111111111111111111111111111110"},
	}
	for _, c := range cases {
		bc := boc.NewCell()
		err := Marshal(bc, c.t)
		if err != nil {
			t.Fatal(err)
		}
		bitString := bc.RawBitString()
		if bitString.BinaryString() != c.s {
			t.Fatal("error")
		}
		var unmarshaled Unary
		err = Unmarshal(bc, &unmarshaled)
		if err != nil {
			t.Fatal(err)
		}
		if !reflect.DeepEqual(c.t.A, unmarshaled) {
			t.Fatalf("not equal. left: %v, right: %v \n", c.t.A, unmarshaled)
		}
		b2 := boc.NewCell()
		err = Marshal(b2, unmarshaled)
		if err != nil {
			t.Fatal(err)
		}
		if bc.ToString() != b2.ToString() {
			t.Fatal("not equal")
		}
	}
}

func TestHashMapE(t *testing.T) {
	// raw transaction with out messages
	s := ""
	data, _ := hex.DecodeString(s)
	cells, _ := boc.DeserializeBoc(data)
	c := cells[0]
	// tag + account_addr + lt + prev_trans_hash + prev_trans_lt + now
	// 4   + 256          + 64 + 256             + 64            + 32
	_ = c.Skip(4 + 256 + 64 + 256 + 64 + 32)
	msgCount, _ := c.ReadUint(15) // outmsg_cnt
	_ = msgCount
	m, _ := c.NextRef() // msgs
	_ = m
	isInMsg, _ := m.ReadBit()
	if isInMsg {
		_, _ = m.NextRef() // in msg
	}
	var res struct {
		OutMsgs HashmapE[Size15, Ref[boc.Cell]]
	}
	err := Unmarshal(m, &res)
	if err != nil {
		t.Fatalf("error: %v", err)
	}
	if len(res.OutMsgs.Keys()) != int(msgCount) {
		t.Fatalf("ivalid number of out messages")
	}
}

