func TestMarchalHashMap(t *testing.T) {

	k1 := boc.NewBitString(16)
	k2 := boc.NewBitString(16)
	k3 := boc.NewBitString(16)
	kstr := "0000000000001101"
	for i := range kstr {
		if string(kstr[i]) == "0" {
			k1.WriteBit(false)
		} else {
			k1.WriteBit(true)
		}
	}
	kstr = "0000000000010001"
	for i := range kstr {
		if string(kstr[i]) == "0" {
			k2.WriteBit(false)
		} else {
			k2.WriteBit(true)
		}
	}
	kstr = "0000000011101111"
	for i := range kstr {
		if string(kstr[i]) == "0" {
			k3.WriteBit(false)
		} else {
			k3.WriteBit(true)
		}
	}
	chm := HashmapE[Size16, Ref[int32]]{}
	chm.m.keys = []boc.BitString{
		k1,
		k2,
		k3,
	}
	chm.m.values = []Ref[int32]{
		{Value: 100},
		{Value: 289},
		{Value: 57121},
	}

	c := boc.NewCell()

	t.Log("Input heshmap: ")
	for i := range chm.Keys() {
		t.Logf("k%v: key: %v, value: %v",
			i,
			chm.Keys()[i].BinaryString(),
			chm.Values()[i].Value)
	}
	err := Marshal(c, chm)
	if err != nil {
		t.Fatalf("error: %v", err)
	}
	var res HashmapE[Size16, Ref[int32]]

	err = Unmarshal(c, &res)
	if err != nil {
		t.Fatalf("error: %v", err)
	}
	t.Log("Output heshmap: ")
	for i := range res.Keys() {
		t.Logf("k%v: key: %v, value: %v",
			i,
			res.Keys()[i].BinaryString(),
			res.Values()[i].Value)
	}
}

func TestEmptyHashMap(t *testing.T) {
	c := boc.NewCell()
	var h HashmapE[Size15, boc.Cell]
	err := Marshal(c, h)
	if err != nil {
		t.Fatal(err)
	}
	if len(c.Refs()) != 0 || c.BitSize() != 1 {
		t.Fatal("invalid cell")
	}
}

func TestHahmapAug(t *testing.T) {
	var cases = []struct{ Name, Boc string }{
		//{Name: "aug-dict-0",
		//	Boc: "te6ccgEBAQEABwAACQAAAABA"},
		{Name: "aug-dict-1",
			Boc: "te6ccgEBAgEAFQABCYAAAAVAAQAVoAACAAAAFAAAAAM="},
		{Name: "aug-dict-2",
			Boc: "te6ccgEBBAEAJwABCYAAAA9AAQIKzQAAAB4CAwARZAAAACgAAAAGABHQAAAAoAAAABQ="},
		{Name: "aug-dict-5",
			Boc: "te6ccgEBCgEAYwABCYAAAEtAAQIKywAAAJYCAwIJAAAADyAEBQIJAAAAFqAICQIJAAAAB6AGBwARsgAAADwAAAAHABFkAAAAKAAAAAYAEdAAAACgAAAAFAAR2AAAAUAAAAAkABGyAAAAZAAAAAs="},
		{Name: "aug-dict-20",
			Boc: ""},
	}

	for _, c := range cases {
		cells, err := boc.DeserializeBocBase64(c.Boc)
		if err != nil {
			t.Fatal(c.Name, err)
		}
		cells[0].WriteUint(15, 5)

		var h struct {
			H      HashmapAugE[Size16, int16, int32]
			Suffix Uint5
		}
		err = Unmarshal(cells[0], &h)
		if err != nil {
			t.Fatal(c.Name, err)
		}
		if h.Suffix != 15 {
			t.Fatal("invalid suffix", c.Name)
		}
		fmt.Println(c.Name)
		fmt.Println(h.H.Values())
	}
}
